To create a sortable Bootstrap table without using jQuery or any plugins, you can use plain JavaScript. Here's a simple example of a sortable table using vanilla JavaScript:

```html
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Sortable Bootstrap Table</title>
  <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0-alpha1/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-KyZXEAg3QhqLMpG8r+Knujsl7/1L_dstPtjYut+1pHl55R6/5sqGpOP9XBssGv+J" crossorigin="anonymous">
</head>
<body>
  <table class="table table-striped">
    <thead>
      <tr>
        <th onclick="sortTable(0)">Name</th>
        <th onclick="sortTable(1)">Age</th>
      </tr>
    </thead>
    <tbody id="myTable">
      <tr>
        <td>Alice</td>
        <td>25</td>
      </tr>
      <tr>
        <td>Bob</td>
        <td>30</td>
      </tr>
      <tr>
        <td>Charlie</td>
        <td>22</td>
      </tr>
      <tr>
        <td>David</td>
        <td>28</td>
      </tr>
    </tbody>
  </table>

  <script>
    function sortTable(n) {
      let table, rows, switching, i, x, y, shouldSwitch, dir, switchcount = 0;
      table = document.getElementById("myTable");
      switching = true;
      dir = "asc";
      while (switching) {
        switching = false;
        rows = table.rows;
        for (i = 1; i < (rows.length - 1); i++) {
          shouldSwitch = false;
          x = rows[i].getElementsByTagName("TD")[n];
          y = rows[i + 1].getElementsByTagName("TD")[n];
          if (dir == "asc") {
            if (x.innerHTML.toLowerCase() > y.innerHTML.toLowerCase()) {
              shouldSwitch = true;
              break;
            }
          } else if (dir == "desc") {
            if (x.innerHTML.toLowerCase() < y.innerHTML.toLowerCase()) {
              shouldSwitch = true;
              break;
            }
          }
        }
        if (shouldSwitch) {
          rows[i].parentNode.insertBefore(rows[i + 1], rows[i]);
          switching = true;
          switchcount ++;
        }
      }
      if (switchcount == 0 && dir == "asc") {
        dir = "desc";
        sortTable(n);
      }
    }
  </script>
</body>
</html>
```

In this example, the `sortTable` function sorts the table rows based on the clicked header. The `n` parameter determines which column to sort. The sorting algorithm is a simple bubble sort, which is not the most efficient for large datasets, but it works well for small tables.

You can customize the table structure, column names, and data as needed. Make sure to include the Bootstrap CSS in your HTML file to style the table.

