To create a CSV downloader using web workers in Ember Octane, follow these steps:

1. Install the necessary dependencies:

```bash
ember install ember-cli-htmlbars
ember install ember-cli-json-api
ember install ember-cli-web-worker
```

2. Create a new service for handling the CSV download:

```bash
touch app/services/csv-downloader.js
```

3. Implement the CSV downloader service:

```javascript
import Service from '@ember/service';
import { inject as service } from '@ember/service';
import { A } from '@ember/array';
import { read } from 'ember-cli-json-api';
import { task, loop, timeout } from 'ember-concurrency';
import CSVBuilder from 'csv-builder';

export default Service.extend({
  store: service(),

  downloadCSV: task(function* (modelName, queryParams) {
    const records = yield* this.store.query(modelName, queryParams);
    const csvData = this._buildCSV(records);
    this._downloadCSV(csvData);
  }),

  _buildCSV(records) {
    const csv = new CSVBuilder({
      separator: ',',
      newline: '\r\n',
      quote: '"',
    });

    const headers = records[0] && Object.keys(records[0]);
    csv.beginDocument();
    csv.beginRow();
    headers.forEach((header) => csv.cell(header));
    csv.endRow();

    records.forEach((record) => {
      csv.beginRow();
      headers.forEach((header) => {
        csv.cell(record[header]);
      });
      csv.endRow();
    });

    csv.endDocument();
    return csv.toString();
  },

  _downloadCSV(csvData) {
    const worker = new Worker('/assets/csv-worker.js');
    worker.postMessage({ data: csvData, type: 'csv' });
  },
});
```

4. Create a new web worker for handling the CSV download:

```bash
touch assets/csv-worker.js
```

5. Implement the CSV download web worker:

```javascript
self.onmessage = function (event) {
