```python
class Node:
    def __init__(self, x):
        self.val = x
        self.left = None
        self.right = None

def serialize(root):
    if not root:
        return []

    queue = [root]
    result = []

    while queue:
        node = queue.pop(0)
        result.append(node.val)

        if node.left:
            queue.append(node.left)
        if node.right:
            queue.append(node.right)

    return result

def deserialize(data):
    if not data:
        return None

    nodes = {}
    for i, x in enumerate(data):
        nodes[x] = Node(x)

    root = nodes[data[0]]
    queue = [root]
    i = 1

    while queue:
        node = queue.pop(0)

        if i < len(data) and data[i] is not None:
            node.left = nodes[data[i]]
            queue.append(node.left)
        i += 1

        if i < len(data) and data[i] is not None:
            node.right = nodes[data[i]]
            queue.append(node.right)
        i += 1

