Here's a basic example of a timeline widget in JavaScript using HTML5 and the jQuery UI library for the slider:

```javascript
// Import jQuery and jQuery UI
import $ from 'jquery';
import 'jquery-ui';

class Timeline {
    constructor(parent, duration, callback) {
        this.parent = parent;
        this.duration = duration;
        this.callback = callback;

        this.slider = $('<div></div>')
            .attr('id', 'timeline-slider')
            .appendTo(parent);

        this.range = $('<div></div>')
            .attr('id', 'timeline-range')
            .css('width', `${100 * this.duration / 60}%`)
            .appendTo(this.slider);

        this.slider.slider({
            min: 0,
            max: this.duration,
            slide: (event, ui) => {
                this.callback(ui.value);
            }
        });

        this.slider.slider('value', 0);
    }
}

// Usage:
const parent = document.getElementById('timeline-container');
const timeline = new Timeline(parent, 60, (seconds) => {
    console.log(`Current time: ${seconds} seconds`);
});
```

In this example, we create a `Timeline` class that takes a parent element, duration in seconds, and a callback function. The constructor sets up the slider and range elements, initializes the slider with the specified duration, and attaches the callback function to the slide event.

The usage example creates a new timeline instance, attaches it to a container with the id 'timeline-container', and sets the duration to 60 seconds (one minute). When the slider is moved, the callback function is called with the new position in seconds.

